import{_ as e,o as t,c as i,O as r}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 36-119.1 Existing buildings.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/36-119.1.md","filePath":"vacode/36-119.1.md"}'),a={name:"vacode/36-119.1.md"},n=r('<h1 id="§-36-119-1-existing-buildings" tabindex="-1">§ 36-119.1 Existing buildings. <a class="header-anchor" href="#§-36-119-1-existing-buildings" aria-label="Permalink to &quot;§ 36-119.1 Existing buildings.&quot;">​</a></h1><p>This chapter shall not supersede provisions of the Fire Prevention Code promulgated by the Board under § <a href="http://law.lis.virginia.gov/vacode/27-97/" target="_blank" rel="noreferrer">27-97</a>, that prescribe standards to be complied with in existing buildings or structures, provided that such regulations shall not impose requirements that are more restrictive than those of the Uniform Statewide Building Code under which the buildings or structures were constructed. Subsequent alteration, enlargement, rehabilitation, repair, or conversion of the occupancy classification of such buildings and structures shall be subject to the construction and rehabilitation provisions of the Building Code.</p><p>1986, c. 429; 1988, c. 199; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0555" target="_blank" rel="noreferrer">555</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0650" target="_blank" rel="noreferrer">650</a>.</p>',3),o=[n];function s(c,l,d,h,u,g){return t(),i("div",null,o)}const f=e(a,[["render",s]]);export{p as __pageData,f as default};
